import React from "react";
import ReactDOM from 'react-dom';
import App from "./App";
import "./index.css";
import {Yess} from "./App";





ReactDOM.render(<>
<ol>
<li><App /></li>
<li><Yess /></li>
</ol>
</>,
document.getElementById("root")
);
